import { styled } from "styled-components";

const SellDiv = styled.div`
  position: relative;
`;

const A = styled.a`
  content: "";
  width: 1px;
  height: 10px;
  border-right: 1px solid rgb(204, 204, 204);
  position: absolute;
  top: 8px;
  right: -15px;
`;

const SBSell = () => {
  return (
    <div className="SBSellDiv">
      <a>
        <img src="https://m.bunjang.co.kr/pc-static/resource/bcc7abb5d531bcf26033.png"></img>
        판매하기
      </a>
    </div>
  );
};

export default SBSell;
